import { Heading,
            Box,
            Grid,
          GridItem } from "@chakra-ui/react"
import { BookList } from "./components/BookList";
import { AddBook } from "./components/AddBook";
import HorizonPic from "../images/HorizonPic.jpg"

function App() {
  return (
    <div className="App">
     <Box bgColor="green.300" p={8} bgImage={HorizonPic} >
      <Heading as="h2" size="3xl" pb={4} m={4} isTruncated>
        Reading List 
        </Heading>
        <BookList/>
        <AddBook/>
       </Box> 
    </div>
  );
}

export default App;
